import React from "react";
import { PokemonInput, Container } from "./Style";

const AddPokemonField = (
    setPokemonName,
    pokemonName
) => {
    return (
        <Container>
            <PokemonInput
                type="text"
                placeholder="Enter pokemon"
                value={pokemonName}
                onChange={(e) => {setPokemonName(e.target.value)}}
            />
        </Container>
    )
}

export default AddPokemonField;
